import React from "react";

function GuessResults({ gusses }) {
  return (
    <div className="guess-results">
      {gusses.map((guess, index) => (
        <p key={index} className="guess">
          <span className="cell">{guess[0]}</span>

        </p>
      ))}
    </div>
  );
}

export default GuessResults;
